import React from 'react';
import { Box, Grid } from '@material-ui/core';

const MainComponent = () => {
    return (
        <>
            <Box>
                <Grid component>
                    <Grid item lg={10} md={11}></Grid>
                </Grid>
            </Box>
        </>
    )
}

export default MainComponent;
